import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h2>Welcome to Our Sports Nutrition Store!</h2>
      <p>Browse through our categories:</p>
      <ul>
        <li><Link to="/category/creatine">Creatine</Link></li>
        <li><Link to="/category/protein">Protein</Link></li>
        <li><Link to="/category/amino-acids">Amino Acids</Link></li>
      </ul>
    </div>
  );
};

export default Home;
